import React from 'react';
// import { Route, BrowserRouter as Router, Switch } from 'react-router-dom';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import axios from 'axios';

import logo from '../../assets/logo.svg';

import '../../scss/navbar.scss';

export default function NavBar() {


  // axios call to get game categories
  const apiCategories = {
    method: 'GET',
    url: 'https://rawg-video-games-database.p.rapidapi.com/genres',
    headers: {
      'x-rapidapi-key': '8e9c448cbdmsh45ad4f34f949b59p1baa83jsn8f4da2d85503',
      'x-rapidapi-host': 'rawg-video-games-database.p.rapidapi.com',
    },
  };

  function getCategories() {
    axios
      .request(apiCategories)
      .then((res) => {
        const categoryArray = res.data.results;
      })
      .catch((error) => console.log(error));
  }

  getCategories();

  return (
    <>
      <Navbar
        collapseOnSelect
        expand="lg"
        variant="dark"
        className="navbar-scss"
      >
        <Navbar.Brand href="/" id="store-name">
          <img src={logo} alt="logo" id="store-logo" />
          Game Nation
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="/store">Store</Nav.Link>
            <NavDropdown title="Browse" id="collasible-nav-dropdown">
              <NavDropdown.Item href="#action/3.1">{}</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.2">Indie</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.3">Adventure</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.4">RPG</NavDropdown.Item>
            </NavDropdown>
          </Nav>
          <Form inline>
            <FormControl
              type="text"
              placeholder="Search"
              className=" mr-sm-2"
              id="navbar-search"
            />
          </Form>
          <Navbar.Brand href="#account" alt="account icon">
            {accountIcon}
          </Navbar.Brand>
          <Navbar.Brand href="#favorites" alt="favorites icon">
            {favoritesIcon}
          </Navbar.Brand>
          <Navbar.Brand href="#cart" alt="cart icon">
            {cartIcon}
          </Navbar.Brand>
        </Navbar.Collapse>
      </Navbar>
    </>
  );
}
